import React from "react";
import styled from "styled-components";

const Para_Heading = ({heading, para1 , heading1 , services_para}) => {
  const {headingData} = heading;
  const {paraData, paraData2, paraData3, paraData4 ,paraData5 ,paraData6} = para1;

  const {headingData1} = heading1;
  const { para2, para3 ,para4 ,para5 , para6, para7} = services_para;
  return (
    <>
      <Wrapper>
        <div className="container">
          <div className="content">
            <h1>{headingData} {headingData1}</h1>
            <p>{para2}</p>
            <p> {para3}</p>
            <p>{para4}</p>
            <p>{para5}</p>
            <p>{para6}</p>
            <p> {para7}</p>
          </div>
        </div>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.section`
padding:9rem 0 0 0;
{
  h1,
  p{
    color:${({theme}) => theme.colors.heading};
    text-align:justify;
    margin:2rem 0 0 0;
  }
}
`;
export default Para_Heading;
